#!/usr/bin/env python3

##
# approach: dqueue and cur vowel count, walk the list
# easy py (cuz slice = ref): walk in blocks, filter/count
#

# %% Cell 1

import sys

def max_vowels_simple(k, text):
    def mv(block):
        n = 0
        for c in block:
            if c in 'aeiou':
                n += 1
        return n

    max = mv(text[0:k])
    for offset in range(1, len(text) - k + 1):
        block = text[offset:offset+k]
        n = mv(block)
        if n > max:
            max = n
    return max

def max_vowels_queue(k: int, text: str) -> int:
    from queue import Queue
    vowels = 'aeiou'
    max = 0
    cur = 0

    q = Queue(maxsize=k)
    for i in text:
        if q.full():
            o = q.get()
            if o in vowels:
                cur -= 1
        q.put(i)
        if i in vowels:
            cur += 1
            if cur > max:
                max = cur

    return max

def max_vowels_paired_iter(k: int, text: str) -> int:
    vowels = 'aeiou' #('a', 'e', 'i', 'o', 'u') #tuple('aeiou')
    # count the first window, then walk forward with 2 iterators to continue updating count

    i = 0
    stop = k if k < len(text) else len(text)
    cur = 0
    while i < stop:
        if text[i] in vowels:
            cur += 1
        i += 1
    max = cur

    i = 0
    j = k
    stop = len(text)
    while j < stop:
        if text[i] in vowels:
            cur -= 1
        if text[j] in vowels:
            cur += 1
            if cur > max:
                max = cur
        i += 1
        j += 1
    return max



def test():
    tests = [
        ('tryhard', 4, 1),
        ('', 1, 0),
        ('aeiou', 1, 1),
        ('aeiou', 2, 2),
        ('aeiou', 3, 3),
        ('aeiou', 4, 4),
        ('aeiou', 5, 5),
        ('abciiidef', 3, 3),
        ('leetcode', 3, 2),
        ('weallloveyou', 7, 4),
        ("", 50436, 9694),
    ]

    for text, k, exp in tests:
        act = max_vowels_paired_iter(k, text)
        assert act == exp, f"max_vowels(...) -> {act} != {exp}"
    else:
        print(f'All {len(tests)} tests passed.')


def main(args):
    test()

if __name__ == '__main__':
    rv = main(sys.argv[:])
    sys.exit(rv)
